import os
import struct
import argparse

def process_folder_43(folder_path):
    ini_files = []

    for filename in os.listdir(folder_path):
        file_path = os.path.join(folder_path, filename)
        if os.path.isdir(file_path):
            process_folder_43(file_path)
        elif (os.path.splitext(filename)[1] == ".ini"
            and "desktop" not in filename.lower()
            and "ntuser" not in filename.lower()
            and "disabled_backup" not in filename.lower()):
            ini_files.append(filename)

    for ini_file in ini_files:
        try:
            print(f"Found: {folder_path} {ini_file}")
            counter = 0
            with open(os.path.join(folder_path, ini_file), "r+", encoding="utf-8") as f:
                data = f.read()

                # 4.1 Fix
                newer = list(old_vs_new.values())
                matching = [x for x in newer if x in data]
                if matching:
                    print("\tIni has already been updated for 4.1")
                else:
                    matching = [x for x in old_hashes_vb_41 if x in data] or [x for x in postionhashes_41 if x in data]

                    if len(matching) < 1:
                        print("\tVB Hash not recognized")

                    for match in matching:
                        if match in oldvsnew_41 and oldvsnew_41[match] not in data:
                            print("\tUpdating ini for 4.1")
                            with open(os.path.join(folder_path,"DISABLED_Backup_41"+ os.path.splitext(ini_file)[0] + ".txt",),"w",encoding="utf-8",) as g:
                                g.write(data)
                            data += f"\n\n; 4.1 Character Fix \n[TextureOverride41FixVertexLimitRaise{counter}]\nhash = {oldvsnew_41[match]}\nmatch_priority = 1"
                            counter += 1
                        elif (match in DetermineCharacterBasedOnPositionHash_41 and DetermineCharacterBasedOnPositionHash_41[match] not in data):
                            print("\tUpdating ini for 4.1")
                            with open(os.path.join(folder_path, "DISABLED_Backup_41"+ os.path.splitext(ini_file)[0]+ ".txt", ),"w",encoding="utf-8",) as g:
                                g.write(data)
                            data += f"\n\n; 4.1 Character Fix \n[TextureOverride41FixVertexLimitRaise{counter}]\nhash = {DetermineCharacterBasedOnPositionHash_41[match]}\nmatch_priority = 1"
                            counter += 1
                        else:
                            print("\tIni has already been updated for 4.1")

                # 4.3 Fix
                matching = [x for x in newer if x in data]
                if matching:
                    print("\tIni has already been updated for 4.3")          
                else:
                    matching = [x for x in old_hashes_ib_43 if str(x) in data] or [x for x in new_hashes_ib_43 if str(x) in data]

                    if len(matching) < 1:
                        print("\tIB Hash not recognized")

                    for match in matching:

                        if match in oldvsnew_43 and oldvsnew_43[match] not in data:
                            print("\tUpdating ini for 4.3")

                            with open(os.path.join(folder_path, "DISABLED_Backup_43" + os.path.splitext(ini_file)[0] + ".txt", ), "w", encoding="utf-8", ) as g:
                                g.write(data)

                            # Too complex to use the same method as 4.1 here, we have to actually replace the IB line
                            output = ""
                            for line in data.splitlines():
                                if match in line:
                                    updated_line = line.replace(match, oldvsnew_43[match])
                                    output += updated_line + "\n"
                                    # Save a backup as a comment just in case
                                    line = ";" + line
                                output += line + "\n"

                            data = output
                        else:
                            print("\tIni has already been updated for 4.3")


                f.seek(0)
                f.write(data)
                f.truncate()
        except Exception as e:
            print("Unable to open, skipping")
            print(f"Error: {e}")

